import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import AccountCircleRoundedIcon from '@material-ui/icons/AccountCircleRounded';
import React from 'react';
import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles( { colorPrimary: { backgroundColor: 'white', color: 'white' } } )
const NavigationBar =
    ( props ) => {
        const classes = useStyles();
        return <AppBar position='static'><Toolbar placement='bottom'><div>Test</div><IconButton edge='end' onClick={ () => { console.log( 'howdy' ) } }><AccountCircleRoundedIcon classes={ { colorPrimary: classes.colorPrimary } } /></IconButton></Toolbar></AppBar>
    }

export default NavigationBar;
